{"query":"query {
    getIdentifiedObject(mRID: "mRID") {
        ... on IdentifiedObject {
            mRID
            name
        }
        ... on Feeder {
            normalHeadTerminal {
                conductingEquipment {
                    mRID
                }
                sequenceNumber
            }
            normalEnergizingSubstation {
                mRID
                name
                subGeographicalRegion {
                    mRID
                    name
                    geographicalRegion {
                        mRID
                        name
                    }
                }
            }
            equipment {
                mRID
            }
            currentEquipment {
                mRID
            }
        }
        ... on Substation {
            feeders {
                mRID
                name
                normalHeadTerminal {
                    conductingEquipment {
                        mRID
                    }
                    sequenceNumber
                }
            }
            subGeographicalRegion {
                mRID
                name
                geographicalRegion {
                    mRID
                    name
                }
            }
        }
        ... on SubGeographicalRegion {
            substations {
                mRID
                name
                feeders {
                    normalHeadTerminal {
                        conductingEquipment {
                            mRID
                        }
                        sequenceNumber
                    }
                }
            }
            geographicalRegion {
                mRID
                name
            }
        }
        ... on GeographicalRegion {
            subGeographicalRegions {
                mRID
                name
                substations {
                    mRID
                    name
                    feeders {
                        normalHeadTerminal {
                            conductingEquipment {
                                mRID
                            }
                            sequenceNumber
                        }
                    }
                }
            }
        }
        ... on PowerTransformer {
            function
            ends {
                endNumber
                ratedS
                ratedU
            }
            assetInfo {
                mRID
            }
        }
        ... on AcLineSegment {
            length
            perLengthSequenceImpedance {
                mRID
            }
            assetInfo {
                ... on OverheadWireInfo {
                    overhead: mRID
                }
                ... on CableInfo {
                    underground: mRID
                }
            }
        }
        ... on Switch {
            isNormallyOpen
            isOpen
        }
        ... on ConductingEquipment {
            terminals {
                sequenceNumber
                phases
                connectivityNode {
                    mRID
                    terminals {
                        mRID
                    }
                }
            }
            baseVoltage {
                nominalVoltage
            }
        }
        ... on Equipment {
            containers {
                ... on Feeder {
                    feeder: name
                }
                ... on LvFeeder {
                    lvFeeder: name
                }
                ... on Site {
                    site: mRID
                    name
                }
                ... on Substation {
                    substation: name
                }
                ... on Circuit {
                    circuit: name
                }
            }
            currentContainers {
                ... on Feeder {
                    feeder: name
                }
                ... on LvFeeder {
                    lvFeeder: name
                }
            }
        }
        ... on PowerSystemResource {
            location {
                points {
                    longitude: xPosition
                    latitude: yPosition
                }
            }
        }
        ... on DiagramObject {
            style
            points {
                x: xPosition
                y: yPosition
            }
            diagram {
                mRID
            }
        }
        ... on EnergyConsumer {
            usagePoints {
                mRID
                name
                names {
                    name
                    type {
                        name
                    }
                }
                endDevices {
                    mRID
                    name
                }
            }
        }
    }
}
"}

