{"query":"query {
    findIdentifiedObjects(
        criteria: {
            toMatch: "search"
            exactMatchesOnly: false # optional
            tryMatchMRID: true # optional
            tryMatchName: true # optional
            tryMatchNameTypeName: true # optional
            includeClasses: ["IdentifiedObject"] # optional
            includeNameTypes: ["NMI"] # optional
            inDiagrams: ["diagramMRID"] # optional
            limit: 100 # optional
        }
    ) {
        mRID
        name
    }
}
"}

{"query":"query {
    findIdentifiedObjectsByName(
        criteria: [{ nameType: "NMI", names: ["1234567890"] }]
    ) {
        mRID
        names {
            name
            type {
                name
            }
        }
    }
}
"}

{"query":"query {
    getAssetInfo(types: "PerLengthSequenceIpedance") {
        mRID
        ... on PerLengthSequenceImpedance {
            r
            x
        }
    }
}
"}

{"query":"query {
    getNetworkHierarchy {
