                mRID
            }
        }
        feeders {
            mRID
            name
            normalEnergizingSubstation {
                mRID
            }
        }
        lvFeeders {
            mRID
            name
            normalEnergizingFeeders {
                mRID
            }
        }
        circuits {
            mRID
            name
            endSubstations {
                mRID
            }
        }
        loops {
            mRID
            name
            energizingSubstations {
                mRID
            }
            substations {
                mRID
            }
            circuits {
                mRID
            }
        }
    }
}
"}

{"query":"query {
    getDownstreamEquipmentTree(
        mRID: "50435442"
        networkState: NORMAL # optional
    ) {
        conductingEquipment {
            mRID
        }
        children
    }
}
"}

{"query":"query {
    findUpstreamEquipment(
        mRID: "mRID"
        type: "Switch" # optional
        networkState: NORMAL # optional
    ) {
        mRID
        name
    }
}
"}

{"query":"query {
    getUpstreamEquipment(
