    ) {
        mRID
        name
    }
}
"}

{"query":"query {
    getConnectedEquipment(
        mRID: "mRID"
        steps: 3 # optional
        networkState: NORMAL # optional
        feederDirection: DOWNSTREAM # optional
    ) {
        conductingEquipment {
            mRID
            name
        }
        step
    }
}
"}

{"query":"query {
    getIsolatedEquipment(
        isolationPoints: [
            {
                mRID: "mRID1"
                longitude: 0.0 # optional paired with latitude
                latitude: 0.0 # optional paired with longitude
            }, {
                mRID: "mRID2"                
            }
        ]
				insideIsolation: [ # optional if isolating below subtrans
            {
                mRID: "mRID3"
                longitude: 0.0 # optional paired with latitude
                latitude: 0.0 # optional paired with longitude
            }, {
                mRID: "mRID4"                
            }
        ]
				maxSwitches: 7 # optional
        type: "Type" # optional
        networkState: NORMAL # optional
    ) {
        mRID
        name
    }
}
"}
